import { MaterialIcons } from '@expo/vector-icons';
function Tile(props) {
    const myicon = props.name ;
    return (
    <Card style = {styles.cardStyle}>
    <Card.Content>
    {props.name == "kitchen" ? <MaterialIcons name="kitchen" size={24} color="black" /> :<MaterialCommunityIcons name={props.name} size={64} color="black" />}
    
